import SpinnerGIF from "../asessts/Spinner2.gif";

const Spinner = () => {
    return(
        <>
            <img src={SpinnerGIF} alt="spinner" className="d-block m-auto" style={{width: "400px"}}/>
        </>
    );
}

export default Spinner;
